import React from 'react';
import { Header } from '../Header';
import styled from 'styled-components';

const Wrapper = styled.section `
    max-width: 1200px;
    padding: 40px 20px;
    margin: 0 auto;
`;

export const Layout = ({ children }) => {
    return (
        <Wrapper>
            <Header />
            { children }
        </Wrapper>
    );
}
